import React from 'react';
import { useNavigate } from 'react-router-dom';
import Rankings from './HomeWidgets/Rankings';
import UpcomingSeries from './HomeWidgets/UpcomingSeries.js';
import FeaturedMatches from './HomeWidgets/FeaturedMatches.js';
import TeamFixtures from './HomeWidgets/TeamFixtures.js';
import News from './HomeWidgets/News';
import './css/Home.css';

const Home = () => {
  const navigate = useNavigate();

  return (
    <div className="home-container">
      <div className="home-section">
        <FeaturedMatches navigate={navigate} />
        <Rankings />
        <TeamFixtures />
      </div>

      <div className="side-widgets">
        <UpcomingSeries />
        <News />
      </div>
    </div>
  );
};

export default Home;
